import React, { Component }  from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLogin: true
    }
  }

  render() {
    const { isLogin } = this.state;

    return (
      isLogin ? <LoginPage></LoginPage> : <HomePage></HomePage>
    );
  }
}

export default App;
